import React, { Component } from 'react';
import './Navbar.css';

class Navbar extends Component {
    render() {
        return (
            <nav class="navbar fixed-bottom navbar-dark bg-dark" id = "navBar">
                <span class="navbar-brand mb-0 h1">{this.props.nome}</span>
            </nav>

        );
    }
}

export default Navbar;
